import circle from "./photo/Group 1.svg"
import './App.css';
function App() {
  return (
    <div className="body">
        <h1 className="back-page">CREATIVE NEW DESIGN</h1>
     <header className="header">
       <p className="logo">logo</p>
         <div className="links">
             <a href="#">menu</a>
             <a href="#">creative</a>
             <a href="#">contact</a>
         </div>
     </header>
        <div className="main-page">
            <div className="main-box">
                <h1>CREATIVE NEW DESIGN</h1>
                <img style={{
                    height: 300,
                }
                }
                    src={circle}/>

            </div>
        </div>

    </div>
  );
}

export default App;
